import React from 'react';

import { Container, Column } from './styles';
import Card from '../Card';

function List({title}) {
  return (
      <>
        <Container>
          <Column>
            <header>
              <h2>{title}</h2>

              <ul>

                 <Card data={'employee '}/>

              </ul>
            </header>
            </Column>
        </Container>
      </>
  );
}

export default List;
